from algorithms.longest_norepeat_substring import Solution

from functools import wraps
from time import time


def elapsed(*args, **kwargs):

    tag = ""
    if 'tag' in kwargs:
        tag = kwargs['tag']

    def decorate(func):
        @wraps(func)
        def wrapper(*args, **kwargs):
            start = time()

            result = func(*args, **kwargs)

            delta = time() - start

            print(tag + " ran in: " + str(delta))

            return result
        return wrapper
    return decorate


class TestLongest:
    @property
    def code(self):
        return Solution()

    def test_case_empty(self):
        test = ""
        expected = 0

        result = self.code.lengthOfLongestSubstring(test)

        assert result == expected

    def test_case_one(self):

        test = "a"
        expected = 1

        result = self.code.lengthOfLongestSubstring(test)

        assert result == expected

    def test_leet_1(self):
        test = "abcabcbb"
        expected = 3

        result = self.code.lengthOfLongestSubstring(test)

        assert result == expected

    def test_leet_69(self):
        test = "aab"
        expected = 2

        result = self.code.lengthOfLongestSubstring(test)

        assert result == expected

    def test_leet_95(self):
        test = "cdd"
        expected = 2

        result = self.code.lengthOfLongestSubstring(test)

        assert result == expected

    def test_leet_407(self):
        test = "dvdf"
        expected = 3

        result = self.code.lengthOfLongestSubstring(test)

        assert result == expected

    def test_leet_unknown(self):
        test = "pwwkew"
        expected = 3

        result = self.code.lengthOfLongestSubstring(test)

        assert result == expected


